import Navbar from '../components/Navbar';

import Fetch from 'isomorphic-unfetch';
import Layout from '../components/Layout';
import News from '../components/News';

const Index = props => (
  <Layout>
    <div>
      <h2>Hello HomePage</h2>
      <p>Holla</p>
      <p>{props.news}</p>
      <News />
    </div>
  </Layout>
);

export default Index;
